import React from "react";

import "./style/service.css";
import cleaner from "../assest/cleaner.jpg";

function Service() {
  const services = [
    {
      id: 1,
      category: "Home Cleaning",
      type: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Debitis, accusamus.",
    },
    {
      id: 2,
      category: "Office Cleaning",
      type: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Debitis, accusamus.",
    },
    {
      id: 3,
      category: "Hotel Cleaning",
      type: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Debitis, accusamus.",
    },
    {
      id: 4,
      category: "Deep Cleaning",
      type: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Debitis, accusamus.",
    },
    {
      id: 5,
      category: "After Cleaning",
      type: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Debitis, accusamus.",
    },
    {
      id: 6,
      category: "Post Construction",
      type: "Lorem ipsum dolor sit amet consectetur, adipisicing elit. Debitis, accusamus.",
    },
  ];
  return (
    <div className="services" id="service">
      <div className="serviceContainer">
        <div className="serviceHeader">
          <h1>Our Services </h1>
        </div>
        <div className="serviceContent">
          {services.map((item) => {
            const { category, type, id } = item;
            return (
              <div className="s-contentContainer" key={id}>
                <img src={cleaner} alt="cardImage" />
                <div className="cardContext">
                  <h3>{category}</h3>
                  <p>Read More</p>
                  <p>{type}</p>
                </div>
                <div className="overlay"></div>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Service;
